import React from "react";


function Dropdown() {
  return (
    <>
        <div class="col-12 dropdown-main">
            <div class="drop-down p-2">HOME</div>
            <div class="select-option drop-down p-2" data-name="about">ABOUT</div>
            <div class="select-option drop-down p-2" data-name="work">WORK</div>
            <div class="select-option drop-down p-2" data-name="contact">CONTACT</div>
        </div>
    </>    
  );
}

export default Dropdown;
